/** @format */

import React from "react";

const App2 = () => {
  return (
    <Provider store={store}>
      <UserProvider>
        <Router>
          <Layout>
            <Switch>
              <Route path="/matters" component={MatterDashboard} />
            </Switch>
          </Layout>
        </Router>
      </UserProvider>
    </Provider>
  );
};

export default App2;
